import React from 'react';
import GameItem from './gameItem'

class Games extends React.Component{

    render(){

       console.log("Hello");

        return this.props.myGames.map((games)=>{
            console.log("Hello");
            console.log({games});

            return <GameItem key={games._id} games={games}></GameItem>
        });
    }
}
export default Games;
